import React from 'react';
import Card from './Componant/Card';
import CardData from './Componant/CardData';
function ncard(val){
   return (
      <Card
      imagsrc={val.imagsrc}
       alt={val.alt}
        title={val.title}
        name={val.name}
        link={val.link}
        />
   )
}

// here we are making componants 
function App(){
return (<>
<h1>Netflix Top Series</h1>
 <div className='netseries'>
{CardData.ncard}

 </div>
  
    </>)
};
export default App;
